import React, { Component } from 'react';
import { Link } from "react-router-dom";

import { Jumbotron, Button } from 'react-bootstrap';
import { Container, Row, Col } from 'react-bootstrap'; // React Bootstrap kütüphanesini içe aktarın

export default class Home extends Component {

    constructor(props) {
        super(props);
        this.state = {
            name: '',
            email: ''
        }
    }

    componentDidMount() {

    }

    render() {
        return (
            <div style={{ padding: '50px 0' }}>
                <Container>
                    <Row className="mb-5">
                        <Col>
                            <h1>Welcome to SynthiLancer</h1>
                            <p>Find the perfect freelancers for your projects!</p>
                            <Button variant="primary">Post a Job</Button>
                        </Col>
                    </Row>
                    <Row className="mb-5">
                        <Col md={8}>
                            <h2>Latest Jobs</h2>
                            <ul>
                                <li>Web Developer Needed - Project X - Company Y</li>
                                <li>Graphic Designer Wanted - Project Z - Company X</li>
                                {/* ... */}
                            </ul>
                        </Col>
                        <Col md={4}>
                            <h2>Top Freelancers</h2>
                            <ul>
                                <li>John Doe - Web Development</li>
                                <li>Jane Smith - Graphic Design</li>
                                {/* ... */}
                            </ul>
                        </Col>
                    </Row>
                    <Row>
                        <Col>
                            <h2>Featured Freelancer Profiles</h2>
                            <Row>
                                <Col md={3}>
                                    <img src="https://example.com/profile1.jpg" alt="Profile 1" />
                                    <h3>John Doe</h3>
                                    <p>Web Developer</p>
                                </Col>
                                <Col md={3}>
                                    <img src="https://example.com/profile2.jpg" alt="Profile 2" />
                                    <h3>Jane Smith</h3>
                                    <p>Graphic Designer</p>
                                </Col>
                                {/* ... */}
                            </Row>
                        </Col>
                    </Row>
                </Container>
            </div>
        );
    }
}
